import React from 'react';
import { Link } from 'react-router-dom';
import IconWidget from './icon_widget';

const MenuSubLink = (props) => {
    return (
        <li className="active_menu">
            <div className="nav justify-content-between ">
                <div className="flex align-items-center">
                    <IconWidget icon={props.MenuIcon} />
                    <span className="text_href margin-left-1em">{props.MenuName}</span>
                </div>
                <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#fff"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z" /></svg>
            </div>
            <ul className="nav_sub">
                <li><a href="employee_management.html">직원 관리</a></li>
                <li><a href="project_management.html">프로젝트 관리</a></li>
                <li><a href="statistics_management.html">통계 및 분석</a></li>
            </ul>
        </li>
    );
};

export default MenuSubLink;
